ter assist other team members.\\r\\n\\r\\n\\r\\n\\r\\nTaking lead on projects, as needed.\\r\\n\\r\\nBack-end Developer Requirements:\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\nBachelors degree in computer programming, computer science, or a related field.\\r\\n\\r\\n\\r\\n\\r\\nMore education or experience may be required.\\r\\n\\r\\n\\r\\n\\r\\nFluency or understanding of specific languages, such as Java, PHP, or Python, and operating systems may be required.\\r\\n\\r\\n\\r\\n\\r\\nStrong understanding of the web development cycle and programming techniques and tools.\\r\\n\\r\\n\\r\\n\\r\\nFocus on efficiency, user experience, and process improvement.\\r\\n\\r\\n\\r\\n\\r\\nExcellent project and time management skills.\\r\\n\\r\\n\\r\\n\\r\\nStrong problem solving and verbal and written communication skills.\\r\\n\\r\\n\\r\\n\\r\\nAbility to work independently or with a group.\\r\\n\\r\\n\\r\\n\\r\\nWillingness to sit at desk for extended periods.", "locationLat": null, "locationLng": null, "benefitsJson": {"auto": false, "sgmm": false, "vida": false, "bonos": false, "otros": false, "vales": false, "celular": false, "comedor": false, "primaVac": true, "aguinaldo": true, "utilidades": true, "vacaciones": true, "combustible": false, "fondoAhorro": false, "primaVacPct": 25, "showBenefits": true, "aguinaldoDias": 15, "vacacionesDias": 12}, "locationType": "REMOTE", "employmentType": "FULL_TIME", "descriptionHtml": "<strong>Back-end Developers Job Description Template</strong><p>We are looking for an analytical, results-driven back-end developer who will work with team members to troubleshoot and improve current back-end applications and processes. The Back-end Developer will use his or her understanding of programming languages and tools to analyze current codes and industry developments, formulate more efficient processes, solve problems, and create a more seamless experience for users. You should have excellent communication, computer, and project management skills.</p><p>